import {img1} from '../Images'
function Partner()
{
    return(
        <div className="partner">
            <h1 className="partner-head">TRUSTED BY OUR PARTNER'S</h1>
            <div className="brand">
                <div>
                    <img src="" className="card-brand"/> 
                </div>
            </div>
        </div>
    );
}

export default Partner;
